(e=>{"use strict";document.addEventListener("DOMContentLoaded",()=>{e.twoFactorMethodChange=()=>{const e=document.getElementById("jform_twofactor_method");if(e){const t="com_users_twofactor_"+e.value;document.querySelectorAll("#com_users_twofactor_forms_container > div").forEach(e=>{const{id:o}=e;o!==t?document.getElementById(o).classList.add("hidden"):document.getElementById(o).classList.remove("hidden")})}},(()=>{const e=document.getElementById("fieldset-accessibility");if(e){e.querySelector("div").remove();const t=document.createElement("div");t.classList.add("alert","alert-info"),t.innerText="Accessibility settings should be changed in your operating system or browser settings.",e.append(t)}})()})})(Joomla);